import React from 'react';
import "./style.css";
import "./Home.css";

const Final = () => { 
  return (
    <div className='main-container'>
      <div className='box'>
        <div className='box-2'>
        <span className='final'>WHAT NEXT ...</span>
          <span className='final'>
            We will send you <br />
             an email on <br />
            1st Feb<br />
            for Your match</span>
        </div>
      </div>
    </div>
  );
}
export default Final;
